*
 * autocomplete elements 모듈
 *
 * @author caias
 * @since 2019.09.06 - draft
 * @example
 *  const Element = require('@otom/elements');
 *  // single module
 *  const element = new Element('input', 'div');
 *  element.css('top', '30px');
 *
 *  // use extends
 *  class El extends Element {
 *    constructor() {
 *      super(el, root);
 *    }
 *
 *    init() {
 *      this.css('top', '30px');
 *    }
 *  }

